-- ----------------------------
-- View structure for xa_member_statistics
-- ----------------------------
DROP VIEW IF EXISTS `xa_member_statistics`;
CREATE ALGORITHM=UNDEFINED DEFINER=`xa`@`%` SQL SECURITY DEFINER VIEW `xa_member_statistics` AS (select `j`.`id` AS `id`,`j`.`agent_code` AS `userNo`,`j`.`agent_name` AS `userName`,`j`.`phone` AS `phone`,`j`.`provinces_id` AS `provinces_id`,`j`.`city_id` AS `city_id`,`j`.`area_id` AS `area_id`,`j`.`address` AS `address`,`j`.`agent_state` AS `states`,`j`.`create_date` AS `create_date`,NULL AS `local_date`,NULL AS `higher_agent_id`,NULL AS `founder`,`k`.`area_name` AS `provinces`,`l`.`area_name` AS `city`,`m`.`area_name` AS `area`,'0' AS `userType` from (((`xa_agent` `j` left join `code_areas` `k` on((`j`.`provinces_id` = `k`.`area_id`))) left join `code_areas` `l` on((`j`.`city_id` = `l`.`area_id`))) left join `code_areas` `m` on((`j`.`area_id` = `m`.`area_id`)))) union (select `a`.`id` AS `id`,`a`.`merchant_number` AS `userNo`,`a`.`vendor_name` AS `userName`,`a`.`merchant_phone` AS `phone`,`a`.`provinces_id` AS `provinces_id`,`a`.`city_id` AS `city_id`,`a`.`area_id` AS `area_id`,`a`.`address` AS `address`,`a`.`business_state` AS `states`,`a`.`create_date` AS `create_date`,NULL AS `local_date`,`a`.`higher_agent_id` AS `higher_agent_id`,`a`.`founder` AS `founder`,`d`.`area_name` AS `provinces`,`e`.`area_name` AS `city`,`f`.`area_name` AS `area`,'1' AS `userType` from (((`xa_business_information` `a` left join `code_areas` `d` on((`a`.`provinces_id` = `d`.`area_id`))) left join `code_areas` `e` on((`a`.`city_id` = `e`.`area_id`))) left join `code_areas` `f` on((`a`.`area_id` = `f`.`area_id`))) where (`a`.`effect_state` = '0')) union (select `c`.`id` AS `id`,`c`.`customer_number` AS `userNo`,`c`.`nick_name` AS `userName`,`c`.`phone` AS `phone`,`c`.`provinces_id` AS `provinces_id`,`c`.`city_id` AS `city_id`,`c`.`area_id` AS `area_id`,`c`.`address` AS `address`,`c`.`merchants_state` AS `states`,`c`.`create_date` AS `create_date`,NULL AS `local_date`,`c`.`agent_id` AS `higher_agent_id`,NULL AS `founder`,`g`.`area_name` AS `provinces`,`h`.`area_name` AS `city`,`i`.`area_name` AS `area`,(select (case `b`.`is_XFConsumers` when '0' then '2' when '1' then '3' end) AS `userType` from `xa_consumers` `b` where (`b`.`id` = `c`.`id`)) AS `Name_exp_17` from (((`xa_consumers` `c` left join `code_areas` `g` on((`c`.`provinces_id` = `g`.`area_id`))) left join `code_areas` `h` on((`c`.`city_id` = `h`.`area_id`))) left join `code_areas` `i` on((`c`.`area_id` = `i`.`area_id`)))) union (select `n`.`id` AS `id`,`n`.`user_number` AS `userNo`,`n`.`user_account` AS `userName`,NULL AS `phone`,NULL AS `provinces_id`,NULL AS `city_id`,NULL AS `area_id`,NULL AS `address`,NULL AS `states`,`n`.`create_date` AS `create_date`,`n`.`local_date` AS `local_date`,NULL AS `higher_agent_id`,`n`.`businessInformation_id` AS `founder`,NULL AS `provinces`,NULL AS `city`,NULL AS `area`,'4' AS `userType` from `xa_consumers_account` `n`) ;

-- ----------------------------
-- View structure for xa_message_object
-- ----------------------------
DROP VIEW IF EXISTS `xa_message_object`;
CREATE ALGORITHM=UNDEFINED DEFINER=`xa`@`%` SQL SECURITY DEFINER VIEW `xa_message_object` AS (select `a`.`id` AS `id`,`a`.`merchant_number` AS `userNo`,`a`.`vendor_name` AS `userName`,`a`.`merchant_phone` AS `phone`,`a`.`provinces_id` AS `provinces_id`,`a`.`city_id` AS `city_id`,`a`.`area_id` AS `area_id`,`a`.`address` AS `address`,`a`.`business_state` AS `states`,`d`.`area_name` AS `provinces`,`e`.`area_name` AS `city`,`f`.`area_name` AS `area`,'0' AS `userType` from (((`xa_business_information` `a` left join `code_areas` `d` on((`a`.`provinces_id` = `d`.`area_id`))) left join `code_areas` `e` on((`a`.`city_id` = `e`.`area_id`))) left join `code_areas` `f` on((`a`.`area_id` = `f`.`area_id`)))) union (select `c`.`id` AS `id`,`c`.`customer_number` AS `userNo`,`c`.`nick_name` AS `userName`,`c`.`phone` AS `phone`,`c`.`provinces_id` AS `provinces_id`,`c`.`city_id` AS `city_id`,`c`.`area_id` AS `area_id`,`c`.`address` AS `address`,`c`.`merchants_state` AS `states`,`g`.`area_name` AS `provinces`,`h`.`area_name` AS `city`,`i`.`area_name` AS `area`,(select (case `b`.`is_XFConsumers` when '0' then '2' when '1' then '1' end) AS `userType` from `xa_consumers` `b` where (`b`.`id` = `c`.`id`)) AS `Name_exp_13` from (((`xa_consumers` `c` left join `code_areas` `g` on((`c`.`provinces_id` = `g`.`area_id`))) left join `code_areas` `h` on((`c`.`city_id` = `h`.`area_id`))) left join `code_areas` `i` on((`c`.`area_id` = `i`.`area_id`)))) ;

-- ----------------------------
-- View structure for xa_other_consumers
-- ----------------------------
DROP VIEW IF EXISTS `xa_other_consumers`;
CREATE ALGORITHM=UNDEFINED DEFINER=`xa`@`%` SQL SECURITY DEFINER VIEW `xa_other_consumers` AS select `a`.`id` AS `id`,`a`.`order_no` AS `order_no`,`a`.`cunsumers_id` AS `cunsumers_id`,`a`.`transaction_num` AS `transaction_num`,`a`.`total_price` AS `total_price`,`a`.`goods_unit_id` AS `goods_unit_id`,`a`.`goods_as` AS `goods_as`,`a`.`rebate` AS `rebate`,`a`.`create_date` AS `create_date`,`a`.`business_id` AS `business_id`,`b`.`user_account` AS `user_account`,`b`.`user_type` AS `user_type` from (((`xa_transaction_records` `a` left join `xa_consumers_account` `b` on((`a`.`cunsumers_id` = `b`.`id`))) left join `per_sys_user` `e` on((`e`.`ID` = `a`.`business_id`))) left join `xa_business_information` `f` on((`f`.`id` = `e`.`merchants_id`))) where (`f`.`id` <> `b`.`businessInformation_id`) ;
